A MobiCascais by Ubirider é a aplicação que combina todos os meios de mobilidade disponíveis no concelho numa única plataforma, simples e intuitiva.
Melhora a experiência e serviço aos utilizadores no planeamento, reserva e pagamento dos serviços necessários às suas deslocações e permite que residentes, trabalhadores e estudantes do concelho beneficiem das vantagens do cartão Viver Cascais.

Com a nova MobiCascais é possível:
> Planeamento, pagamento pré-viagem e validação dos títulos de transporte desmaterializados e orientação em viagem;
> Possibilidade de definição de rotas favoritas para simplificar a utilização;
> Informação de perturbações que afetem os percursos agendados;
> Carregamento do cartão Viver Cascais ou Cartão Navegante e compra de bilhetes na rede municipal de transportes de Cascais;
> Estacionamento nas áreas de estacionamento de rua no concelho de Cascais e respetivo pagamento;
> Localização das paragens dos autocarros e consulta dos respetivos horários;
> Benefícios de estacionamento no concelho e transportes municipais gratuitos para residentes, trabalhadores e estudantes.
> Acompanhamento da posição do autocarro no mapa em real time. 

Uma nova experiência de utilização, mais intuitiva e mais completa.
MobiCascais, consigo nas viagens do dia a dia!

O AppBarber é um aplicativo para gestão e agendamentos online para Barbearias onde tanto o profissional da Barbearia quanto os clientes podem acessar.

Para o cliente, é totalmente free. O cliente só precisa baixar o aplicativo, fazer o cadastro no AppBarber e se vincular à Barbearia de preferência. O cliente pode:

- Agendar seu horário; 
- Gravar seus lembretes;
- Receber Notícias e Promoções;
- Receber Mensagens de Retorno;
- Responder a Pesquisa de Satisfação do Atendimento;
- Avaliar a Barbearia;
- Participar da Rede Social Barbearia x Cliente;
- Consultar Histórico;
- Pagar online;
...e muito mais

Para a Barbearia, pode ser cadastrada via website e experimentar por 30 dias grátis todas as funcionalidades como:

- Agendamentos Online via Webadmin e App;
- Caixa;
- Financeiro;
- Gestão de Pacotes;
- Gestão de Estoque;
- Programa de Fidelidade;
- Pesquisa de Satisfação;
- Lista de Espera;
- Mensagens automáticas de Retorno;
... e muito mais.

Os Planos podem ser contratados via sua conta do iTunes, direto do aplicativo, apenas para Planos Mensais, via planos auto-renováveis e da seguinte forma:

- Assinatura do Plano Mensal do AppBarber;

- Assinaturas auto-renováveis estão disponíveis na App Store para o AppBarber;

- O pagamento será cobrado na sua conta do iTunes na confirmação da compra e será renovado automaticamente (na duração / preço selecionado), a menos que a renovação automática seja desativada pelo menos 24 horas antes do final do período atual;

- A conta será cobrada para renovação dentro de 24 horas antes do final do período atual;

- A assinatura atual não pode ser cancelada durante o período de assinatura ativo; no entanto, você pode gerenciar sua assinatura e / ou desativar a renovação automática visitando a configuração da conta do iTunes após a compra;

- Qualquer parcela não utilizada do período inicial de um mês gratuito será perdida quando você comprar uma assinatura.

- Termos de Uso e Políticas de Privacidade podem ser consultados em: https://appbarber.com.br/termodeuso/TermosDeUso_AppBarber.pdf

Se você não assinou pelo iTunes, poderá gerenciar seu plano/assinatura pelo próprio AppBarber.
